import React from 'react'
import { EyeOutlined, GoldOutlined, ReconciliationOutlined, PoundCircleOutlined } from '@ant-design/icons'
import ChartistGraph from "react-chartist";

const Dashboard = () => {


    return (
        <div className='Dashboard-div'>
            <h2>Dashboard</h2>
            <h3>Analytics</h3>
            <div className='Sec-1'>
                <div className='Card'>
                    <EyeOutlined className='icon' />
                    <h3>Total Views</h3>
                    <h4>8990</h4>
                </div>
                <div className='Card'>
                    <GoldOutlined className='icon' />
                    <h3>Total Orders</h3>
                    <h4>990</h4>
                </div>
                <div className='Card'>
                    <PoundCircleOutlined className='icon' />
                    <h3>Total Earning</h3>
                    <h4>$42290</h4>
                </div>
                <div className='Card'>
                    <ReconciliationOutlined className='icon' />
                    <h3>Total Ads</h3>
                    <h4>23</h4>
                </div>
            </div>
            <div className='Sec-2'>
                <div className='Revenue-Chart-div'>
                <ChartistGraph
                    data={{
                        labels: ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday'],
                        series: [
                          [12, 9, 7, 8, 5],
                          [2, 1, 3.5, 7, 3],
                          [1, 3, 4, 5, 6]
                        ]
                    }}
                    type="line" options={{
                      seriesBarDistance: 10,
                      axisX: { showGrid: false, }, height: "245px",
                    }}
                    responsiveOptions={[
                      [
                        "screen and (max-width: 640px)",
                        {
                          seriesBarDistance: 5,
                          // axisX: {
                          //   labelInterpolationFnc: function (value) {
                          //     return value[0];
                          //   },
                          // },
                        },
                      ],
                    ]}
                  />
                </div>
                <div className='Order-Chart-div'></div>
            </div>
        </div>
    )
}

export default Dashboard
